import React from "react";
import { StyleSheet } from "react-native";

const StyleHeadr = StyleSheet.create({
    header :{
        display: "flex",
        flexDirection: 'row',
        width: "100%",
        height:'10%',
        backgroundColor: '#E7E6E4',
        borderwidth:5,
        borderColor : '#A19C91'
    },
    container :{
        display: "flex",
        flexDirection: 'row',
        width: '80%',
        alignItems:'center',
        justifyContent: 'space-around'
    }
});

export default StyleHeadr;
